> なんか既に少しだけUniswapにKEEPのプールあるんですね。
@kyoronut 
ユニスワップにKEEPオプションがありません。メインネットを使用していますか？蛇口があるのでテストネットKEEPがあるかもしれません。

> ステークドロップは6月８日からだけど、
> ５月１１日から始まるのって何かあるの？
@cryptochick 英語で書かれていますが、インセンティブテストネットゲーム「Playing for Keeps」を開催しています。 6か月間継続し、受賞者にはコミュニティの貢献のためのKEEPトークンが与えられます。貢献する方法があれば教えてください。これに関する詳細は間もなく掲載されます。これは「ステークドロップ」に追加されます。https://blog.keep.network/how-to-play-for-keeps-297f246455d4

> よーし、あとはwindowsのノートPCでノードが運用できたら完璧☆　VPSとかやったことなくてわからんｗ
@cryptochick 
定期的に再接続しない限り、ラップトップでノードを実行したくない場合があります。これは、オフライン時に「slashing」が発生する可能性があるためです。定期的にインターネットに接続している場合は問題ないかもしれませんが、これらは考慮すべきことです。

@Kris 回答ありがとうございます。署名者がETHをステークするのはBTCをDecentralizedな形でEthereumに持ち込むために必要なコストという位置づけだと理解しました。
slashingと一言で言っても、そのペナルティの内容には種類があるのですね。StakeDropに参加する場合はその内容を正しく理解する必要があるということが分かりました。
「スラッシング」で伝わりますので大丈夫です！

> Keepは元々Enigmaに近いイメージだと思いますよ。Data Marketとか出るんじゃないでしょうか
@Shingen 
Enigmaも似ていますが、Keepの直接のライバルかどうかはわかりません

> @Kris それは素晴らしいです！ ところでStakedropも同様にNode Runningが必要でしょうか？
@Shingen 
ETHは署名グループ内の1つの署名者に委任される必要があるため、ノードもStakedropで実行する必要があると思います。これは、署名がノードによって管理されるために必要です。

> これは、もうステーキングができるのかな。
> どうしたら良いのかいまいち理解できない…。
@aoi_jp あなたがすでにテストネット上にいるなら、それはあなたが今する必要があるすべてです 🙂

@Kris Thank you!
Does it mean I don't have to do anything?
※わたしはtestnetでnodeを実行しています。 🙂

